" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Magnetic resonance imaging of markedly obese patient with mistaken clinical diagnosis of joint effusion",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 324px; height: 280px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    False clinical impression of joint effusion in a markedly obese patient with rheumatoid arthritis. Axial T1 weighted image through the mid-patella shows no significant joint effusion. The normal collapsed medial recess of the knee joint is denoted by arrow heads. As can be seen by the hypothetical needle tract (long arrow), a 1.5 inch needle could not reach this patient's joint via a medial approach. However, a lateral approach could be successful.",
"    <div class=\"footnotes\">",
"     M: medial side; L: lateral side.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Roberts,WN, Hayes CW, Breitbach SA, et al. Am J Med 1996; 100:461.",
"    </div>",
"   </div>",
