"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H18049457\">",
"      <span class=\"h1\">",
"       What is a ganglion cyst?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A ganglion cyst is a small sac of fluid that forms over a joint or tendon.",
"     </p>",
"     <p>",
"      Common places for a ganglion cyst are:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Wrist (",
"        <a class=\"graphic graphic_picture graphicRef83118 \" href=\"UTD.htm?29/49/30494\">",
"         picture 1",
"        </a>",
"        )",
"       </li>",
"       <li>",
"        Finger joints",
"       </li>",
"       <li>",
"        Top of the foot",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Ganglion cysts can also form on the knee, shoulder, back, or other parts of the body.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18049472\">",
"      <span class=\"h1\">",
"       What are the symptoms of a ganglion cyst?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Swelling",
"       </li>",
"       <li>",
"        Pain",
"       </li>",
"       <li>",
"        Trouble moving a joint &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18049487\">",
"      <span class=\"h1\">",
"       Is there a test for ganglion cyst?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If you have a bump that looks like a ganglion cyst, the doctor or nurse will probably be able to tell what it is just by doing an exam. He or she might also shine a powerful light into it. If light passes through, that means the bump is filled with fluid. This tells the doctor it could be a ganglion cyst.",
"     </p>",
"     <p>",
"      If the doctor or nurse is not sure what is causing your symptoms, he or she might order an imaging test such as an MRI or an ultrasound. Imaging tests create pictures of the inside of the body.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18049502\">",
"      <span class=\"h1\">",
"       How is a ganglion cyst treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Some ganglion cysts go away without any treatment. Your doctor or nurse might wait to see if the cyst goes away on its own.",
"     </p>",
"     <p>",
"      If you do get treatment, the doctor or nurse might:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Drain the cyst &ndash; Doctors can stick a needle into a cyst and take out the fluid. Sometimes they also inject a medicine into the cyst that can help keep fluid from coming back. &nbsp;",
"       </li>",
"       <li>",
"        Do surgery &ndash; The doctor might take out the cyst and fix any damaged tissue nearby.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18049517\">",
"      <span class=\"h1\">",
"       What if my symptoms do not get better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If your symptoms do not get better, talk with your doctor or nurse. If you have been waiting to see if the ganglion cyst goes away without treatment, you might need treatment. &nbsp;",
"     </p>",
