"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?0/21/344/abstract/1\">",
"      American College of Obstetricians and Gynecologists. Committee Opinion No. 559: Cesarean Delivery on Maternal Request. Obstet Gynecol 2013; 121:904.",
"     </a>",
"    </li>",
