var title_f0_21_348="Histopathological classification of tendon disorders";
var content_f0_21_348=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F78153&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F78153&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Histopathological classification of tendon disorders",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Pathological diagnosis",
"       </td>",
"       <td class=\"subtitle1\">",
"        Macroscopic pathology",
"       </td>",
"       <td class=\"subtitle1\">",
"        Histopathological findings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tendinosis",
"       </td>",
"       <td>",
"        Intratendinous degeneration (commonly due to aging, microtrauma, vascular compromise)",
"       </td>",
"       <td>",
"        Collagen disorientation, disorganization and fiber separation by an increase in mucoid ground substance, increased preponderance of cells and vascular spaces with or without neovascularization and focal necrosis or calcification",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tendinitis",
"       </td>",
"       <td>",
"        Symptomatic degeneration of the tendon with vascular disruption and inflammatory repair response",
"       </td>",
"       <td>",
"        Degenerative changes as noted above with superimposed evidence of tear, including fibroblastic and myofibroblastic proliferation, hemorrhage, and organizing granulation tissue",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Paratenonitis",
"       </td>",
"       <td>",
"        \"Inflammation\" of the outer layer of tendon (paratenon) alone, whether or not the paratenon is lined by synovium",
"       </td>",
"       <td>",
"        Mucoid degeneration if the areolar tissue is seen; a scattered mild mononuclear infiltrate with or without focal fibrin deposition and fibrinous exudate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Paratenonitis with tendinosis",
"       </td>",
"       <td>",
"        Paratenonitis associated with intratendinous degeneration",
"       </td>",
"       <td>",
"        Degenerative changes as noted in tendinosis with mucoid degeneration with or without fibrous and scattered inflammatory cells in the paratenon alveolar tissue",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Khan KM, Cook JL, Bonar F, et al. Histopathology of common tendinopathies. Update and implications for clinical management. Sports Med 1999; 27:393 with permission from Adis, a Wolters Kluwer business. Copyright &copy; Adis Data Information BV 1999. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
