var title_f0_21_349="Common antibiotic and anticoagulant lock solutions";
var content_f0_21_349=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F83938&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F83938&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Final concentrations of common antibiotic lock solutions with anticoagulant for treatment of catheter-related bloodstream infections",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Antibiotic and concentration",
"       </td>",
"       <td class=\"subtitle1\">",
"        Heparin concentration (units/mL)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Maximum dwell time",
"        <br/>",
"        (duration of stability)",
"       </td>",
"       <td class=\"subtitle1\">",
"        References&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        For gram-positive activity",
"       </td>",
"       <td>",
"        Cefazolin 5 mg/mL",
"       </td>",
"       <td>",
"        5000",
"       </td>",
"       <td>",
"        24 hours",
"       </td>",
"       <td>",
"        [1]",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vancomycin&nbsp;5 mg/mL",
"       </td>",
"       <td>",
"        5000",
"       </td>",
"       <td>",
"        72 hours",
"       </td>",
"       <td>",
"        [2]",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        For gram-negative activity",
"       </td>",
"       <td>",
"        Ceftazidime 10 mg/mL",
"       </td>",
"       <td>",
"        5000",
"       </td>",
"       <td>",
"        72 hours",
"       </td>",
"       <td>",
"        [3]",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gentamicin 1 mg/mL",
"       </td>",
"       <td>",
"        2500",
"       </td>",
"       <td>",
"        72 hours",
"       </td>",
"       <td>",
"        [4]&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Combinations for both gram-positive and gram-negative activity",
"       </td>",
"       <td>",
"        Cefazolin 10 mg/mL and gentamicin 5 mg/mL",
"       </td>",
"       <td>",
"        5000",
"       </td>",
"       <td>",
"        48 hours",
"       </td>",
"       <td>",
"        [5]",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vancomycin 10 mg/mL and gentamicin 5 mg/mL",
"       </td>",
"       <td>",
"        5000",
"       </td>",
"       <td>",
"        48 hours",
"       </td>",
"       <td>",
"        [5]&nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    This table lists clinically useful antibiotics in combination with heparin at doses for which there are optimal stability and/or in vitro efficacy data. If lower doses of heparin are used, the antibiotic dose often must be decreased as well to maintain stability. Antibiotic lock solutions for the treatment of catheter-related bloodstream infections should&nbsp;be used in conjunction with systemic antibiotic therapy.&nbsp;Antibiotic concentrations may decrease to subtherapeutic levels in the distal lumen of the catheter when dwell times exceed 48 hours, but for hemodialysis catheters, it is reasonable to allow the solution to dwell during the interval between sessions, up to 72 hours. If the line must be accessed for alternate use during the dwell time, the lock solution should be removed and later replaced anew.",
"    <div class=\"footnotes\">",
"     <em>",
"      1.",
"     </em>",
"     <em>",
"      Bookstaver PB, Williamson JC, Tucker BK, et al. Activity of novel antibiotic lock solutions in a model against isolates of catheter-related bloodstream infections. Ann Pharmacother 2009; 43:210.",
"      <br>",
"       2. LaPlante KL, Mermel LA. In vitro activity of daptomycin and vancomycin lock solutions on staphylococcal biofilms in a central venous catheter model. Nephrol Dial Transplant 2007; 22:2239.",
"      </br>",
"     </em>",
"     <br>",
"      <em>",
"       3.",
"      </em>",
"      <em>",
"       Vercaigne LM, Sitar DS, Penner SB, et al. Antibiotic-heparin lock: in vitro antibiotic stability combined with heparin in a central venous catheter. Pharmacotherapy 2000; 20:394.",
"       <br>",
"        4. Krishnasami Z, Carlton D, Bimbo L, et al. Management of hemodialysis catheter-related bacteremia with an adjunctive antibiotic lock solution. Kidney Int 2002; 61:1136.",
"        <br>",
"         5.",
"        </br>",
"       </br>",
"      </em>",
"      <em>",
"       Vercaigne LM, Zelenitsky SA, Findlay I, et al. An in vitro evaluation of the antibiotic/heparin lock to sterilize central venous haemodialysis catheters. J Antimicrob Chemother 2002; 49:693.",
"      </em>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
